import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Banner from "./components/components-sm/Banner";
import ChooseUs from "./components/components-sm/ChooseUs";
import AboutMe from "./components/components-sm/AboutMe";
import Courses from "./components/components-sm/Courses"
import Testimonial from "./components/components-sm/Testimonial";
import Join from "./components/components-sm/Join";
import Dashboard from "./components/Dashboard";
import Footer from "./components/Footer";

function App() {
  return (
    <>
      <Navbar />
      <Home />
      <Banner />
      <ChooseUs />
      <AboutMe />
      <Courses />
      <Testimonial />
      <Join />
      {/* <Dashboard />
      <Footer /> */}
    </>
  );
}

export default App;
